import React from "react";
import { Link } from "react-router-dom"; 

export default function Post() {

  const markdownFiles = [
    {name : "카테고리1", post :[
    { name: "대학공부", content: "내용1" }, 
    { name: "유니티", content: "내용2" }
    ]},
    {name : "카테고리2", post :[
      { name: "대학공부", content: "내용1" }, 
      { name: "유니티", content: "내용2" }
      ]}
  ]

  //페이지 데이터 받아서 글자 출력  
  return (
    <div>
    <h2>카테고리 목록</h2>
    {markdownFiles.map((category, index) => (
      <div key={index}>
        <h3>{category.name}</h3>
        <ul>
          {category.post.map((post, postIndex) => (
            <a key={postIndex}>
              <strong>{post.name}</strong>: {post.content}
            </a>
          ))}
        </ul>
      </div>
    ))}
  </div>
  );

  
}
